import { useState } from 'react';
import './App.css';
import PokeCard from './components/PokeCard';

function App() {
  const [party, setParty] = useState([
    "blastoise","charizard","dragonair","gyarados","salamence","umbreon","blaziken","bidoof","mewtwo"
  ])
  return (
    <div className="App">
      <h1>hey it's me!</h1>
      {/* <PokeCard pokemon="blastoise"/> */}
      <div className='poke-list'>
      {
        party.map((name,i)=>{
          return <PokeCard key={i} pokemon={name}/>
        })
      }
      </div>
    </div>
  );
}

export default App;
